import React, { FC } from "react";
import { Container,Text } from "./style";

interface Props {
  name: string,
  time:string,
  color:string,
  execute: any

}
const Task: React.FC<Props> = ({execute, name,time,color,  ...props }: Props) => {

  return (
    <Container color={color}>
      <Text onClick={execute}>
        {name}
      </Text>
      <Text>
        {time}
      </Text>
    </Container>
  );
};

export default Task;
